import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({
  drinksHeader: {
    marginLeft: 20,
    margin: 20,
    fontFamily: "Roboto",
    fontStyle: "normal",
    fontWeight: "normal",
    fontSize: 14,
    lineHeight: 16,
    color: "#7E7E7E",
  },
  filterIcon: {
    marginRight: 20,
  },
  end: {
    justifyContent: "center",
    alignItems: "center",
  },
  endText: {
    color: "#FF7F50",
    fontFamily: "Roboto",
    fontStyle: "normal",
    fontWeight: "normal",
    fontSize: 20,
    padding: 20,
  },
});
